import{o as d,c as r,a as e,d as n,p as m,u as f,r as i,b as t}from"./app-fa882b30.js";const a="data:image/webp;base64,",g={id:"metadataDiv"},u=n('<h3 class="headingFont" style="color:#152350;padding-top:3%;"><b>DataHub Metadata Requirements</b></h3><div class="lead-paragraph metadataSection flex-area_row"><p> The ITS DataHub is a web-system designed for storing and making any open, non-personally identifiable data generated by the ITS Joint Program Office (JPO) funded projects discoverable. The information below is required for a project to be posted to the ITS DataHub if it has been approved by the ITS JPO Data Program. If you have a project that you would like to request having its data included in the ITS DataHub, please contact the ITS JPO Data Program by emailing <a href="mailto:data.itsjpo@dot.gov" style="color:navy;">data.itsjpo@dot.gov</a> with the name of your project, points of contact, and information on how the project is funded (JPO, FHWA, etc.). If you have any questions, please also email <a href="mailto:data.itsjpo@dot.gov" style="color:navy;">data.itsjpo@dot.gov</a>. </p></div><div class="metadataContent"><div class="lead-paragraph metadataSection flex-area_row"><img class="metadataIcon" width="45" height="45" alt="Green circle icon" src="'+a+'"><h5 class="headingFont">Outline of Data Provided</h5><p class="metadataText"> This is the area where the overall outline of the data is presented. Is the data being provided as a one-time action or will it be provided in a continuous fashion? How large is the data being provided? If it’s a one-time action and if the data provided is in multiple files, please outline the hierarchy of the data (e.g., is there a single ‘main’ file and multiple support files, or are there multiple main outputs?) If it is not clear from the file name, please provide the exact file names here and a one-sentence description of the file’s purpose,. This would help the ITS JPO Data Team decide the best way to ingest and publicize the data. If you have documentation covering this information (i.e., Data Management Plan), please provide it instead of the description. </p></div><div class="lead-paragraph metadataSection flex-area_row"><img class="metadataIcon" width="45" height="45" alt="Green circle icon" src="'+a+'"><h5 class="headingFont">Description</h5><p class="metadataText"> This is the area with a brief description of the data being made available and a background on the project that generated the data. If multiple files are being provided as part of a single dataset, provide a brief description on how they are related to each other, with additional detail on the ‘main’ dataset. Please provide sufficient detail and information for a third party to easily understand the submitted data. </p></div><div class="lead-paragraph metadataSection flex-area_row"><img class="metadataIcon" width="45" height="45" alt="Green circle icon" src="'+a+'"><h5 class="headingFont">Contact Name and Email</h5><p class="metadataText"> Please provide a name and email address of a point of contact who is a knowledgeable person on the dataset. This does not obligate the contact person to answer these or any other questions, but it would help us to track the impact of any subsequent work as a result of reusing your submitted data for additional research. It may be best practice to include a general office or organization email, along with a name of an individual who is knowledgeable about the project/data. </p></div><div class="lead-paragraph metadataSection flex-area_row"><img class="metadataIcon" width="45" height="45" alt="Green circle icon" src="'+a+'"><h5 class="headingFont">Geographic Coverage</h5><p class="metadataText"> This is a general description of the area where the data are collected, such as “I-90”, or “Leesburg, VA”, or “Florida.” The more detail/specificity you provide, the better it is for other users to understand the location(s) where the data were collected. </p></div></div><div class="lead-paragraph metadataSection flex-area_row" style="margin-left:50px;padding:10px;"><img class="metadataIcon" width="45" height="45" alt="Green circle icon" src="'+a+'" style="left:-28px;"><h5 class="headingFont">Column Descriptions</h5><p class="metadataText"> For each ‘main’ dataset, please provide brief descriptions of each column. If you have a data dictionary in another file type such as a spreadsheet, CSV, or metadata file, please provide it, and record the exact name of the file here. Please be as descriptive as possible to help others understand your data. </p></div><img class="contentIndicator" width="69" height="69" style="top:-40px;left:0;" src="'+m+'" alt="Content Indicator Arrow">',5),v=n('<h2>Example</h2><div class="exampleContent"><div class="lead-paragraph metadataSection flex-area_row"><h4>Outline of Data Provided</h4><p class="exampleText"> Main dataset is a 5 GB csv file of Basic Safety Messages (bsm_output.csv). Support files are also included that describe the weather conditions (weather.csv, 500 MB) and congestion as measures by other sensors (congestion.pnf, 1.3 GB). Data will be provided one-time as a full package of results from the project. </p></div><div class="lead-paragraph metadataSection flex-area_row"><h4>Description</h4><p class="exampleText"> This dataset contains data collected from the Connected Vehicle (CV) prototype demonstration conducted on I-81 in Virginia. 53 vehicles and 21 trucks that regularly traverse the highway were equipped with aftermarket on-board units (OBUs) to generate Basic Safety Messages (BSMs). The collected BSMs were then anonymized before being included here. </p></div><div class="lead-paragraph metadataSection flex-area_row"><h4>Contact Name and Email</h4><p class="exampleText">John Doe, jdoe@gmail.com</p></div><div class="lead-paragraph metadataSection flex-area_row"><h4>Geographic Coverage</h4><p class="exampleText">I-81 from Winchester, VA to Front Royal, VA</p></div><div class="metadataSection flex-area_row"><h4>Column Descriptions</h4><table><tr><th>Column Name</th><th>Description</th></tr><tr><td>Lat</td><td>Latitude of BSM</td></tr><tr><td>Long</td><td>Longitude of BSM</td></tr><tr><td>Speed</td><td>Speed of vehicle in MPH</td></tr><tr><td>Acceleration</td><td>Lateral acceleration of vehicle in m/s^2</td></tr><tr><td>Heading</td><td>Heading of vehicle in degrees (0-360)</td></tr><tr><td>Steering_Angle</td><td>Angle of steering column</td></tr><tr><td>partII_width</td><td>(Optional) width of vehicle</td></tr><tr><td>partII_length</td><td>(Optional) length of vehicle</td></tr></table></div></div>',2),A={__name:"DataRequirements",setup(l){const o="/data/DataHubMetadataTemplate.docx";return(c,s)=>(d(),r("div",g,[u,e("div",{id:"metaexampleDiv"},[v,e("div",{id:"metadataButtonDiv"},[e("a",{href:o,class:"button"},"DOWNLOAD THE TEMPLATE HERE")])])]))}},I={id:"searchTerms"},b={__name:"SubmissionView",setup(l){return f({title:"Department of Transportation - ITS DataHub | Metadata Guidelines",meta:[{name:"description",content:"A guide to submitting data to the ITS DataHub."}]}),(o,c)=>{const s=i("HeaderDOT"),h=i("Navigation"),p=i("FooterDOT");return d(),r("div",I,[e("header",null,[t(s)]),e("nav",null,[t(h)]),e("main",null,[t(A)]),e("footer",null,[t(p)])])}}};export{b as default};
